<script>
var sumNumbers = function (root) {
  if (!root) return null

  const result = []
  const dfs = (node, str) => {
    if (!node) {
      result.push(str)
    }
    str += node.val
    dfs(node.left, str)
    dfs(node.right, str)
  }
  dfs(root, '')
  console.log(result)
  return result.reduce((total, cur) => total + parseInt(cur), 0)
}
console.log(sumNumbers([1, 5, 9, 1, 5, 9], 2,3))
</script>
